<script>
  import Oscuro from "./Oscuro.svelte";
  import PocketBase from 'pocketbase'
  import {enabled} from '$lib/stores/enabled'
  import { onMount } from 'svelte';
  import {usuario} from '$lib/stores/usuario'
  import { goto } from '$app/navigation';
  import { createRoler } from "$lib/stores/defaultrol.svelte";
  import { createDarker } from "$lib/stores/dark.svelte";
  import { page } from '$app/stores';  
  import { createCaber } from "$lib/stores/cab.svelte";
  let { children} = $props();
  let pageurl = $page.url.pathname  
  let ruta = import.meta.env.VITE_RUTA
  const pb = new PocketBase(ruta);
  let darker = createDarker()
  let leido = $state(true)
  let notificaciones = $state([])
  let cab = $state({
      exist:false,
      nombre:"",
      id:""
  })
  
  let nombreusuario = $state('')
  let usuarioid = $state('')
  let roler = createRoler()
  
  let rol = roler.rol==""?"":roler.rol=="vet"?"Veterinario":"Establecimiento"
  let nombreestablecimiento = $state("")
  
  //let rol = "cab"
  onMount(async ()=>{
    let caber = createCaber()
    nombreestablecimiento = caber.cab.nombre
    if (window.innerWidth <= 600) { // Pantallas pequeÃ±as
      nombreestablecimiento= nombreestablecimiento.slice(0,15)
    }
    
    let pb_json = JSON.parse(localStorage.getItem('pocketbase_auth'))
    usuarioid = pb_json.record.id
    nombreusuario = pb_json.record.username
    
    let hab = $enabled
    if(hab==="no"){
      goto("/")
    }
    
    cab = caber.cab      
    await getNotis()
  })
  
  function salir(){
      pb.authStore.clear();
      usuario.set('')
      enabled.set("no")
      goto("/")
  }
  function editarUser(){
    goto("/user/config")
  }
  function cambiarEstablecimiento(){
    goto("/establecimientos")
  }
  let checked = $state('');
  function handleClick() {
      (checked == 'checked') ? checked = '': checked = 'checked';
  }
  async function getNotis() {
    const records = await pb.collection('notificaciones').getFullList({
        sort: '-created',
        filter: `destino = '${usuarioid}' && leido = False`
    });
    
    notificaciones = records
    if(notificaciones.length>0){
      leido = false
    }
    
  }
  async function leerNotis() {
    leido = true
    for(let i = 0;i<notificaciones.length;i++){
      try{
        let data = {leido:true}
        await pb.collection('notificaciones').update(notificaciones[i].id, data);

      }
      catch(err){
        console.error(err)
      }
    }
  }
  let bgnav = "bg-green-500"
  let classtext=`text-lg px-2 font-extrabold`
  let classnavbarr=`navbar ${bgnav}`
  let classtextnavbar = `text-white font-extrabold dark:text-gray-700`
</script>


<div class="drawer min-h-screen dark:bg-gradient-to-br dark:from-gray-900 dark:to-gray-800">
    <input id="my-drawer" type="checkbox" class="drawer-toggle" bind:checked={checked} />
    <div class="drawer-content w-full">
        <div class={classnavbarr}>
            <div class="flex-none">
              
              <button
                aria-label="menu" 
                class={`mx-1 px-0 btn btn-ghost ${classtextnavbar}`} onclick={handleClick}>

                
                <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" fill="currentColor" class="size-6">
                  <path fill-rule="evenodd" d="M3 6.75A.75.75 0 0 1 3.75 6h16.5a.75.75 0 0 1 0 1.5H3.75A.75.75 0 0 1 3 6.75ZM3 12a.75.75 0 0 1 .75-.75h16.5a.75.75 0 0 1 0 1.5H3.75A.75.75 0 0 1 3 12Zm0 5.25a.75.75 0 0 1 .75-.75h16.5a.75.75 0 0 1 0 1.5H3.75a.75.75 0 0 1-.75-.75Z" clip-rule="evenodd" />
                </svg>
              </button>
            </div>
            <div class="flex-1">
              <a href="/inicio" 
                class={`ps-0 btn btn-ghost text-xl ${classtextnavbar}`}
              >
                {nombreestablecimiento}
              </a>
            </div>
            <div class="flex mr-1 pr-1 lg:mr-5 lg:pr-5">
              <details class="dropdown dropdown-end">
                <summary class={`btn m-0 p-0 bg-transparent hover:bg-transparent ${classtextnavbar} border-none`} onclick={leerNotis}>

                  <div class="indicator">
                    {#if !leido}
                      <span class="indicator-item badge dark:badge-error badge-error badge-xs"></span>
                    {/if}
                    
                    <span class={` px-2`} >{nombreusuario}</span>
                    
                  </div>
                </summary>
                
                <ul class={`menu dropdown-content w-52 rounded-box z-[1] shadow ${classtextnavbar} ${bgnav}`}>
                  {#if notificaciones.length == 0}
                    <li><span>Sin notificaciones</span></li>  
                  {:else}
                    {#each notificaciones as n}
                      <li><span>{n.titulo}</span></li>  
                    {/each}
                  {/if}
                </ul>
              </details>
              
              <details class="dropdown dropdown-end">
                <summary class={`btn btn-square btn-ghost ${classtextnavbar}`}>
                  <svg
                    xmlns="http://www.w3.org/2000/svg"
                    fill="none"
                    viewBox="0 0 24 24"
                    class="inline-block h-5 w-5 stroke-current">
                    <path
                      stroke-linecap="round"
                      stroke-linejoin="round"
                      stroke-width="2"
                      d="M5 12h.01M12 12h.01M19 12h.01M6 12a1 1 0 11-2 0 1 1 0 012 0zm7 0a1 1 0 11-2 0 1 1 0 012 0zm7 0a1 1 0 11-2 0 1 1 0 012 0z"></path>
                  </svg>
                </summary>
                <div class="pr-3 mr-3">
                  <ul class={`menu dropdown-content rounded-box z-[1] shadow ${classtextnavbar} ${bgnav}`}>
                    <li><button onclick={editarUser}>Usuario</button></li>
                    <li><button onclick={cambiarEstablecimiento}>Establecimientos</button></li>
                    <li><button onclick={salir}>Salir</button></li>
                    
                  </ul>
                </div>
                
              </details>
              <Oscuro></Oscuro>
            </div>
        </div>
        {@render children()}
    </div>
    <div class="drawer-side">
      <label for="my-drawer" aria-label="close sidebar" class="drawer-overlay"></label>
      
      <ul 
        class="
          menu bg-gradient-to-br from-white to-gray-100 
          dark:from-gray-900 dark:to-gray-800 
          text-base-content min-h-full 
          w-2/3 lg:w-1/4 p-4
        "
      >
        <div class="border-b border-green-500 ">
          <h1 class="text-lg text-green-600 dark:text-green-400 italic">{`Fertil - ${nombreestablecimiento}`}</h1>
        </div>
        {#if rol=="Veterinario"}
          <li class={`mt-2 ${pageurl.includes("tactos")?"bg-green-400 text-green-900 dark:bg-green-900 dark:text-green-200 bg-opacity-25":""} rounded-full`}>
            
            <a class = {classtext} href="/tactos/vet">
              <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="size-10">
                <path stroke-linecap="round" stroke-linejoin="round" d="m2.25 12 8.954-8.955c.44-.439 1.152-.439 1.591 0L21.75 12M4.5 9.75v10.125c0 .621.504 1.125 1.125 1.125H9.75v-4.875c0-.621.504-1.125 1.125-1.125h2.25c.621 0 1.125.504 1.125 1.125V21h4.125c.621 0 1.125-.504 1.125-1.125V9.75M8.25 21h8.25" />
              </svg>
              <span class="px-3"> Tactos </span>       
              
            </a>
          </li>
          <li class={`${pageurl.includes("perfil")?"bg-green-400 text-green-900 dark:bg-green-900 dark:text-green-200 bg-opacity-25":""} rounded-full`}>
            <a class = {classtext} href="/perfil">
              <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="size-10">
                <path stroke-linecap="round" stroke-linejoin="round" d="m2.25 12 8.954-8.955c.44-.439 1.152-.439 1.591 0L21.75 12M4.5 9.75v10.125c0 .621.504 1.125 1.125 1.125H9.75v-4.875c0-.621.504-1.125 1.125-1.125h2.25c.621 0 1.125.504 1.125 1.125V21h4.125c.621 0 1.125-.504 1.125-1.125V9.75M8.25 21h8.25" />
              </svg>          
              <span class="px-3"> Perfil </span>       
            </a>
          </li>
        {:else if rol=="Establecimiento"}
        <li  class={`mt-2 ${pageurl.includes("inicio")?"bg-green-400 text-green-900 dark:bg-green-900 dark:text-green-200 bg-opacity-25":""} rounded-full`}>
          <a class = {classtext} href="/inicio">
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="size-8">
              <path stroke-linecap="round" stroke-linejoin="round" d="m2.25 12 8.954-8.955c.44-.439 1.152-.439 1.591 0L21.75 12M4.5 9.75v10.125c0 .621.504 1.125 1.125 1.125H9.75v-4.875c0-.621.504-1.125 1.125-1.125h2.25c.621 0 1.125.504 1.125 1.125V21h4.125c.621 0 1.125-.504 1.125-1.125V9.75M8.25 21h8.25" />
            </svg>              
            <span class="px-3 flex items-center">
              <div>
                Inicio
              </div>
            </span>
          </a>
        </li>
        <li  class={`${pageurl.includes("establecimiento")?"bg-green-400 text-green-900 dark:bg-green-900 dark:text-green-200 bg-opacity-25":""} rounded-full`}>
          <a class = {classtext} href="/establecimiento">
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" class="hidden size-10">
              <path stroke-linecap="round" stroke-linejoin="round" d="m21 7.5-2.25-1.313M21 7.5v2.25m0-2.25-2.25 1.313M3 7.5l2.25-1.313M3 7.5l2.25 1.313M3 7.5v2.25m9 3 2.25-1.313M12 12.75l-2.25-1.313M12 12.75V15m0 6.75 2.25-1.313M12 21.75V19.5m0 2.25-2.25-1.313m0-16.875L12 2.25l2.25 1.313M21 14.25v2.25l-2.25 1.313m-13.5 0L3 16.5v-2.25" />
